import React from 'react';
import '../styles/Wallet.css';

function Wallet({name, message, image}){
    return(
        <div className='wallet__comp'>
            <div>{name} <img src={image} alt="logo"/></div>
            <p>{message}</p>
        </div>
    );
}

export default Wallet;
